function () {
  var frauds = ListFrauds.data;
  const newList = [];
  for (const object of frauds) {
    const sourceEvents = object.source_events;
    newList.push({
      id: Math.floor(Math.random() * 1000000),
      policy: object.policy,
      sources: "Compra1: " + sourceEvents[0] + "\nCompra2: " + sourceEvents[1]
    });
  }
  return newList;
}

function () {
  var saved = RelativeSaved.data;
  const newList = [];
  var months = 0;
  var sum = 0;
  for (const object of saved) {
    sum = sum + object.value;
    months = months + 1;
    newList.push({
      x: object.month,
      y: sum / months
    });
  }
  return newList;
}

